import React from 'react'
import { GluestackUIProvider, Image, Text, View, } from '@gluestack-ui/themed'
import { config } from '@gluestack-ui/config'

export default function HomePage() {
  return (
    <GluestackUIProvider config={config}>
      <View p="$2" backgroundColor='$primary0' flex={1}>
        {/* <Text color='$amber500' fontSize="3em" fontWeight="bold">NoteSketch</Text> */}
        <Image size="2xl" borderColor={$primary800} alignContent='center' justifyContent='center' source={require('../img/note.png')} />


      </View>
    </GluestackUIProvider>
  )
}
